from fastapi import Response, APIRouter
from fastapi.responses import JSONResponse
from starlette import status

from models.user import UserLogin
from utils.hash import hash_password

router = APIRouter(
    prefix="/auth",
    tags=["Authentication"]
)

globaluser = ['felixb.', '9f86d081884c7d659a2feaa0c55ad015a3bf4f1b2b0b822cd15d6c15b0f00a08', 'data:image/png;base64,']


@router.post("/login")
def login(user: UserLogin, response: Response):
    try:
        password_hash = hash_password(user.password)

        if user.username == globaluser[0] and password_hash == globaluser[1]:
            response.status_code = status.HTTP_200_OK
            return JSONResponse(content={"success": 1, "user": globaluser})
        else:
            response.status_code = status.HTTP_401_UNAUTHORIZED
            return JSONResponse(content={"success": 0, "message": "Login Fehlgeschlagen!"})

    except Exception as e:
        response.status_code = status.HTTP_500_INTERNAL_SERVER_ERROR
        return JSONResponse(content={"error": e})


@router.post("/logout")
def logout():
    try:
        return JSONResponse(content={"success": 1})
    except Exception as e:
        return JSONResponse(content={"error": e})
